import 'react-native-gesture-handler';
import * as React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import {
    ProfileStackScreen,
    CartStackScreen,
    OrdersStackScreen,
    MoreStackScreen,
    PetDetailsStackScreen,
} from "./StackNav"; 

import DrawerContent from "../components/DrawerContents";
import nav from "./MaterialBottomTabNav";

const Stack = createStackNavigator();

function StackScreens() {
    return (
      <Stack.Navigator
        initialRouteName="StackScreen"
        headerMode="none"
        mode="card"
      >
        <Stack.Screen
          name="Home"
          component={nav}
        />
        <Stack.Screen
          name="PetDetails"
          component={PetDetailsStackScreen}
          options={{
            tabBarVisible: false
          }}
        />
      </Stack.Navigator>
    );
  }

const Drawer = createDrawerNavigator();

export default function MyDrawerNavigator() {
    return (
        <NavigationContainer>
            <Drawer.Navigator drawerContent={props => <DrawerContent { ...props} /> } >
                <Drawer.Screen name="Home" component={StackScreens} />
                <Drawer.Screen name="Profile" component={ProfileStackScreen} />
                <Drawer.Screen name="Cart" component={CartStackScreen} />
                <Drawer.Screen name="Orders" component={OrdersStackScreen} />
                <Drawer.Screen name="More" component= {MoreStackScreen} />
            </Drawer.Navigator>
        </NavigationContainer>
    );
  }
